public class Third {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i;
		for(i=1;i<=6;i++) {
			if(i==3) {
				System.out.print((i+1)+""+(i+1));
				i=i+1;
				System.out.println();
				continue;
				
				
			}
			else{System.out.print(i+""+(i+1));
			System.out.println();}
		}

	}

}
